module Advent5
    ( advent5_1, advent5_2, input, input2
    ) where

import Data.Char

reduceR [] a = [a]
reduceR l@(a:x) b
    | canReduce a b = x
    | otherwise = (b:l)

canReduce a b = (same a b ) && (differentPolarities a b)
    where same a b = (toLower a) == (toLower b)
          differentPolarities a b = (isLower a) /= (isLower b)

-- Answers

advent5_1 = length $ reverse $ foldl (reduceR) [] input

advent5_2 = 0

